        <button className='roomBtn' onClick={()=>{props.changeTable("allTasks")}}>All-flyts</button>
        <button className='roomBtn' onClick={()=>{props.changeTable("myTask")}}>sort-flyts</button>
        <button className='roomBtn' onClick={()=>{props.changeTable("newTask")}}>add-fly</button>
        <button className='roomBtn' onClick={()=>{props.changeTable("historyTask")}}>delete-flyt</button>
        <button className='roomBtn' onClick={()=>{navigate('/')}}>Exite</button>
    </div>
  )
}
